import cv2
import numpy as np

img = cv2.imread("boat.jpg", 0)

# Compute DFT
dft = np.fft.fft2(img)
dft_shift = np.fft.fftshift(dft)

# Function to calculate energy retention
def energy_retention(image, cutoff):

    dft = np.fft.fft2(image)
    dft_shift = np.fft.fftshift(dft)

    # Total energy in the original image
    total_energy = np.sum(np.abs(dft_shift) ** 2)

    # Create mask for filtering
    mask = np.zeros(image.shape, np.uint8)
    crow, ccol = image.shape[0] // 2, image.shape[1] // 2
    cv2.circle(mask, (ccol, crow), cutoff, 1, -1)

    # Retained energy after filtering
    retained_energy = np.sum(np.abs(dft_shift * mask) ** 2)

    # Calculate energy retention percentage
    return (retained_energy / total_energy) * 100

# Define cutoff frequency
cutoff = 30

# Calculate energy retention before applying LPF
energy_before = energy_retention(img, cutoff)
print(f"Energy Retention Before LPF: {energy_before:.2f}%")

